For the signal $x[n] = \left(\frac{1}{3}\right)^n \cdot 1[n]$, we can find the z-transform as follows:

$\begin{align}
X(z) &= \sum\_{n=0}^{\infty} x[n] \cdot z^{-n} \\
&= \sum\_{n=0}^{\infty} \left(\frac{1}{3}\right)^n \cdot z^{-n} \\
&= \sum\_{n=0}^{\infty} \left(\frac{z^{-1}}{3}\right)^n
\end{align}$

This is an infinite geometric series with a ratio of $\frac{z^{-1}}{3}$. The sum of an infinite geometric series is given by:

$\begin{align}
X(z) = \frac{1}{1 - \frac{z^{-1}}{3}} = \frac{3}{3 - z^{-1}}
\end{align}$

To find the poles, we need to find the values of $z$ that make the denominator zero:

$\begin{align}
3 - z^{-1} &= 0 \\
z^{-1} &= 3 \\
z &= \frac{1}{3}
\end{align}$

There is only one pole at $z = \frac{1}{3}$.

The region of convergence (ROC) is the set of all values of $z$ for which the infinite series converges. In this case, the series converges when the magnitude of $\frac{z^{-1}}{3}$ is less than 1:

$\begin{align}
\left|\frac{z^{-1}}{3}\right| &< 1 \\
|z^{-1}| &< 3 \\
|z| &> \frac{1}{3}
\end{align}$

The ROC is therefore the exterior of a circle with radius $\frac{1}{3}$ centered at the origin.

In summary, the z-transform of $x[n] = \left(\frac{1}{3}\right)^n \cdot 1[n]$ is:

$\begin{align}
X(z) &= \frac{3}{3 - z^{-1}} \\
\text{Poles:} \quad z &= \frac{1}{3} \\
\text{ROC:} \quad |z| &> \frac{1}{3}
\end{align}$

