The `SSLCertRequestInfo` struct in the OpenSSL library contains information about a certificate request, including the certificate authority (CA) that issued the certificate.

To print the certificate authority field from an `SSLCertRequestInfo` object, you can use the `X509_get_issuer_name()` function from the OpenSSL library. This function returns a pointer to an `X509_NAME` structure that contains the issuer's (i.e., the CA's) name.

Here's an example code snippet that demonstrates how to print the certificate authority field from an `SSLCertRequestInfo` object:
```c
#include <openssl\/ssl.h>
#include <openssl\/err.h>

int main(int argc, char **argv)
{
    \/\/ Create a new SSL certificate request
    SSL_CTX *ctx = SSL_CTX_new(TLS_client_method());
    SSL_CTX_use_certificate_file(ctx, "path\/to\/cert.pem", SSL_FILETYPE_PEM);
    SSL_CTX_use_private_key_file(ctx, "path\/to\/key.pem", SSL_FILETYPE_PEM);

    \/\/ Get the certificate request information
    SSLCertRequestInfo *req = SSL_get_cert_request_info(ctx);

    \/\/ Print the certificate authority field
    X509_NAME *issuer = X509_get_issuer_name(req->cert_info->cert);
    char *issuer_str = X509_NAME_oneline(issuer, NULL, 0);
    printf("Certificate authority: %s\n", issuer_str);

    \/\/ Clean up
    SSL_CTX_free(ctx);
    SSL_free(req);
    X509_free(issuer);

    return 0;
}
```
This code creates a new SSL certificate request using the `SSL_CTX_use_certificate_file()` and `SSL_CTX_use_private_key_file()` functions, and then retrieves the certificate request information using the `SSL_get_cert_request_info()` function.

