SemaphoreHandle_t serialSemaphore;

void setup() {
  Serial.begin(115200);
  while (!Serial) {
    ; \/\/ wait for serial port to connect. Required for native USB port only
  }

  xSemaphoreTake(serialSemaphore, portMAX_DELAY);

  \/\/ Test core count
