Here is a function to calculate Fibonacci numbers in Java:

```java
public static int fibonacci(int n) {
  if (n <= 1) {
    return n;
  }

  int[] fibArray = new int[n+1];
  fibArray[0] = 0;
  fibArray[1] = 1;

  for(int i=2; i<=n; i++) {
    fibArray[i] = fibArray[i-1] + fibArray[i-2]; 
  }

  return fibArray[n];
}
```

To use it:

```java 
int result = fibonacci(6); \/\/ returns 8
```

How it works:

- It takes the index n as a parameter to calculate the nth Fibonacci number
- Base cases are 0th and 1st numbers which are 0 and 1 
- An array is used to store already calculated numbers to avoid recalculation
- A for loop iterates from 2 to n and calculates each number by adding previous two numbers
- The nth number is returned from the array

This utilizes dynamic programming approach by storing calculated numbers to improve efficiency compared to direct recursive approach.

