    }
    return fibonacci(n-1) + fibonacci(n-2);
}
```
This function uses a recursive approach to calculate the Fibonacci numbers. It starts by checking if the input `n` is equal to 0 or 1, in which case the result is 0 or 1, respectively. Otherwise, it calculates the Fibonacci number for `n-1` and `n-2` recursively and adds them together to get the result.

